import React from 'react';
import { Link } from 'react-router-dom'; // Assuming you're using React Router for navigation
import './Navbar.css'; // Custom styles for the Navbar

const Navbar = () => {
  return (
    <nav className="navbar" style={styles.navbar}>
      <div className="container">
        <Link to="/" className="navbar-brand" style={styles.logo}>Your Brand</Link>
        <div className="navbar-links">
          <Link to="/home" style={styles.link}>Home</Link>
          <Link to="/shop" style={styles.link}>Shop</Link>
          <Link to="/features" style={styles.link}>Features</Link>
          <Link to="/contact" style={styles.link}>Contact</Link>
        </div>
        <div className="navbar-icons">
          <span style={styles.cart}>ðŸ›’</span> {/* Cart icon */}
          <button className="btn" style={styles.loginButton}>Login</button>
        </div>
      </div>
    </nav>
  );
};

// Custom styles as per your requirements
const styles = {
  navbar: {
    backgroundColor: '#EFE8C2',
    fontFamily: 'Poppins, sans-serif', // Ensure Poppins is loaded in your project
  },
  logo: {
    color: '#224F34',
    fontWeight: 'bold',
    fontSize: '24px',
  },
  link: {
    color: '#224F34',
    marginRight: '20px',
    textDecoration: 'none',
    fontSize: '18px',
  },
  cart: {
    color: '#224F34',
    fontSize: '24px',
    marginRight: '20px',
  },
  loginButton: {
    backgroundColor: '#EFE8C2',
    border: '1px solid #224F34',
    color: '#224F34',
    padding: '8px 16px',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

export default Navbar;
